pragma solidity ^0.5.0;

// Enable the ABI v2 Coder
pragma experimental ABIEncoderV2;

contract carRegistrationContract {

    struct Registration {

        string registrationNumber; //licence plate
        string VIN; // Vehichle Identification Number - stelnummer
        int allowedTotalWeight; //in kg
        int fuel; //eg benzin
        int fuelConsumption; //in km/l
        int amountOfSeats;

    }

    mapping (address => User) public Users;
    mapping (string => Registration) Registrations;
    mapping (string => SalesPosting) SalesPostings;


    function getRegistration(string memory key) public view returns(Registration memory r) {
        return Registrations[key];
    }

    function setRegistration(string memory key, Registration memory _reg) public {
        Registrations[key] = _reg;
    }

    function getSalesPostingId(string memory key) public view returns(string memory r) {
        return SalesPostings[key].id;
    }

    function getSalesPostingOffers(string memory key) internal view returns(mapping (uint=>Offer) memory offers) {
        return SalesPostings[key].offers;
    }

    function test(string memory key) public view returns(Offer[] memory _offers) {
        uint offerLength = SalesPostings[key].offerLength;
        Offer[] memory o = new Offer[](offerLength);
        for(uint i = 0; i<offerLength; i++) {
            o[i] = SalesPostings[key].offers[i];
        }
        return o;    
    }

   

    struct User {
        address userId;
        mapping (uint => Registration) registrations;
        uint registrationsLength;
        mapping (uint => SalesPosting) salesPostings;
        uint salesPostingsLength;
        uint money;
    }

    struct SalesPosting {
        string id;
        uint sellingPrice;  
        address userId;
        mapping (uint => Offer) offers;
        uint offerLength;       

    }

    struct Offer {
        address buyerId;
        uint offerAmount;
    }

    function getSalesPostingOffer(string memory salesPostingId, uint offerIndex) 
        public view returns (Offer memory reg) {
        return SalesPostings[salesPostingId].offers[offerIndex];
    }

    function getUserRegistration(address user, uint index) public view returns (Registration memory reg) {
        return Users[user].registrations[index];
    }

    function createRegistration(string memory registrationNumber, string memory VIN, int awt, int fuel, int fc, int ass) public {
        setRegistration(VIN, Registration(registrationNumber, VIN, awt, fuel, fc, ass));         
    }

    function assignRegistration(address user, string memory _VIN) public {
        User storage u = Users[user];
        u.registrations[u.registrationsLength] = getRegistration(_VIN);
        u.registrationsLength++;
    }

    function createUser(uint money) public returns (bool success) {
        Users[msg.sender] = User(msg.sender, 0, 0, money);
        return true;
    }

    function createSalesPost(string memory _registration, uint _sellingPrice) public returns (bool success) {
        User storage user = Users[msg.sender];
        for (uint i = 0; i<user.registrationsLength; i++) {
            string memory vin = user.registrations[i].VIN;
            if(keccak256(bytes(vin)) == keccak256(bytes(_registration))) {
                user.salesPostings[user.salesPostingsLength] = (SalesPosting(_registration, _sellingPrice, msg.sender, 0));
                user.salesPostingsLength++;
                SalesPostings[_registration] = (SalesPosting(_registration, _sellingPrice, msg.sender, 0));
                return true;
            }
        }
        return false;
    }

    function makeOffer(string memory _salesPosting, uint _offerPrice) public returns (bool sucess) {
        SalesPosting storage posting = SalesPostings[_salesPosting];
        posting.offers[posting.offerLength] = Offer(msg.sender, _offerPrice);
        posting.offerLength++;
        
        return true;
    }

    //only one offer pr. user pr. salesposting right now 
    function acceptOffer(address _buyerId, string memory _salesPosting) public returns (bool success) { 
        User storage seller = Users[msg.sender];
        User storage buyer = Users[_buyerId];
        for (uint i = 0; i<seller.registrationsLength; i++) {
            if(keccak256(bytes(seller.registrations[i].VIN)) == keccak256(bytes(_salesPosting))) { //check if sender is owner of registration
                for(uint j = 0; j<seller.salesPostingsLength; j++) {
                    if(keccak256(bytes(seller.salesPostings[j].id)) == keccak256(bytes(_salesPosting))) { //check is sender has registration up for sale
                        for(uint k = 0; k<seller.salesPostings[j].offerLength; k++) {
                            if(seller.salesPostings[i].offers[k].buyerId==_buyerId) { //find the correct offer
                                uint finalPrice = seller.salesPostings[i].offers[k].offerAmount;
                                buyer.money -= finalPrice; //remove money from buyer
                                seller.money += finalPrice; //add money to seller
                                Registration storage registration = seller.registrations[i]; 
                                buyer.registrations[buyer.registrationsLength] = registration; //transfer registration to buyer
                                buyer.registrationsLength++;
                                delete seller.registrations[i]; //delete registration for seller
                                delete seller.salesPostings[j]; //delete salesPosting
                                return true;
                            }
                        }
                    }
                }                
            }
        }
        return false;
    }




}
